Part5 Q17 t-SNE
I see 5 clusters in the data with this representation and it is consistent with the 5 cell types in the dataset.

Part5 Q18 Compare t-SNE and PCA
a) t-SNE does a better job on clearly separating the cell types in the reduced-dimensional space. It is effective at visualizing clusters of similar data points (eg. BRCA and PRAD, which overlap in the PCA scatterplot). In comparison, PCA provides a more interpretable transformation of the data, allowing for insights into the contributions of individual genes to the principal components.

b) It is hard to identify significant genes directly from the plot because of the non-linear feature of t-SNE. But if a certain gene corresponds to distinct cell types, then it means that the feature also contributes to the separation of the clusters. We can try to set the color to a specific feature and see whether it is important to different cell types. See the scatterplot below.</textarea></div></div><div id="5846838432" class="selected" onclick="pybridge._select_item(this.id)"><section class="section"><h1>Scatter Plot <span class="timestamp">Thu Apr 11 24, 23:11:26</span></h1><div class="content">
